Uala allows you to find and book the best beauty salons, showing you real prices and verified reviews. It helps you choose the salon closest to you, even for a last minute treatment. Book your appointment online, 24 hours a day, avoiding waiting on the phone.

Search and book with Uala:
- Find hairdressers and beauticians where you prefer or around you, by activating geolocation;
- Search for a treatment and find out in which salons near you there is room, on the day and time you prefer;
- You can see where and when there is room immediately and book an appointment instantly;
- Read the reviews of other users and find the salon most in line with your expectations;
- Book your appointment at any time, choosing the person of the staff you want to make an appointment with;
- Pay in cash directly at the salon or by credit card and Paypal in the App;
- Receive emails and notifications that remind you of the day and time of the appointment.

Why Uala?
- Leader in the searching/booking beauty treatment in the EU;
- 24 hour booking, at no additional cost on booking;
- verified reviews of salon users.

List of available services:
- Hairdressers - woman cut, fold, extension, shatush, balayage, man cut
- Beauty center - manicure, gel nails, semi-permanent manicure, groin waxing, full leg waxing, pulsed light, diode laser, eyelash extensions, eyebrows, make up, eyelash perm
- Spa and massages - Ayurvedic massage, draining massage, anti-cellulite massage, Thai massage

Talk to us:
If you need help or if you want to give us your advice, write to hello@uala.it
